import headerbg from "./small-memory-lp.jpg";
import photo from "./ma_photo.png"

let styles = {
    header: {
        backgroundImage:'url('+headerbg+')',
        width:'100%',
        height: '10%',
        minHeight: '16em',
        backgroundSize:'cover',
        backgroundPosition:'center'
    },

    photo: {
        position:'absolute',
        backgroundImage: 'url(' + photo + ')',
        backgroundSize:'cover',
        backgroundPosition: 'center',
        height: '15em',
        width: '10em',
        backgroundRepeat: 'no-repeat',
        marginLeft : '10%',
        marginTop: '5%',
        boxShadow : '10x'
    }
};

export default styles;
